import React from "react";
import { Canvas } from "react-three-fiber";
import { AlphaFormat } from "three";

const Ship = () => {
  return (
    <>
      <p>AAAAAAAAAAA</p>
      <Canvas>
        <mesh>
          <boxBufferGeometry
            attach="geometry"
            args={(1, 1, 1)}
            AlphaFormat="false"
          />
          <AlphaFormat></AlphaFormat>
        </mesh>
      </Canvas>
    </>
  );
};

export default Ship;
